682=NASA 证实木星卫星欧罗巴有水汽，研究报告发表在《Nature Astronomy》期刊上。欧罗巴在已知 79 颗木星卫星中第四大，有稀薄的大气层，科学家已经有证据显示其表面冰层下有液态水，有时可能会通过巨大间歇泉逃逸到太空，但之前还无法直接确认水存在于大气层中。NASA 科学家现在利用夏威夷的望远镜首次确认欧罗巴大气层中有水汽。领导这项研究的 NASA 行星科学家 Lucas Paganini 称，基本化学元素如碳、氢、氧、氮、磷和硫，以及能量来源，生命所需的三大条件中的两个在太阳系中无处不在，但第三个条件液态水则在地球之外很难找到。虽然科学家还没有直接发现液态水，但他们发现了最接近的：蒸汽形式的水。
